import {Link} from "react-router-dom";

const PersonInfoCard = ({person, isSeller}) => {
    return (
        <>
            <div className="card">
                <div className="card-header">
                    {isSeller ? "Dodavatel" : "Odběratel"}
                </div>
                <div className="card-body">
                    <h5 className="card-title">{person.name}</h5>
                    <h6 className="card-subtitle">Email: {person.mail}</h6>
                    <p className="card-text">Telefon: {person.telephone}</p>
                    <p className="card-text">Adresa: {person.street}
                                                     {person.zip}
                                                     {person.city}
                        {person.country}
                    </p>
                </div>
            </div>
        </>
    );

};

export default PersonInfoCard;
